// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Registration {
    struct User {
        address userAddress;
        string userType; // "Student" or "Donor"
        bool isRegistered;
        string ipfsHash;
    }

    mapping(address => User) public users;
    uint256 public totalApplications;
    uint256 public totalApplicationAmount;

    event UserRegistered(address indexed userAddress, string userType, string ipfsHash);
    event DocumentSubmitted(address indexed userAddress, string ipfsHash);
    event UserReset(address indexed userAddress);

    function registerUser(string memory _userType, string memory _ipfsHash) public {
        require(!users[msg.sender].isRegistered, "User is already registered");
        users[msg.sender] = User(msg.sender, _userType, true, _ipfsHash);
        emit UserRegistered(msg.sender, _userType, _ipfsHash);
    }

    function getUser(address _userAddress) public view returns (User memory) {
        return users[_userAddress];
    }

    function submitDocument(string memory _ipfsHash) public {
        require(users[msg.sender].isRegistered, "User is not registered");
        users[msg.sender].ipfsHash = _ipfsHash;
        totalApplications++;
        emit DocumentSubmitted(msg.sender, _ipfsHash);
    }

    function resetUser(address _userAddress) public {
        delete users[_userAddress];
        emit UserReset(_userAddress);
    }

    function getTotalScholarshipApplications() public view returns (uint256) {
        return totalApplications;
    }

    function getTotalScholarshipAmount() public view returns (uint256) {
        return totalApplicationAmount;
    }

    function incrementTotalApplicationAmount(uint256 _amount) external {
        totalApplicationAmount += _amount;
    }
}
